    <script>
        const DEFAULT_FONT_SIZE = 16
 const docEl = document.documentElement
  let userWebsetFontDefaultSize = DEFAULT_FONT_SIZE
  if (docEl.currentStyle) {
    userWebsetFontDefaultSize = docEl.currentStyle['fontSize']
  } else {
    userWebsetFontDefaultSize = getComputedStyle(docEl, false)['fontSize']
  }
  userWebsetFontDefaultSize = parseFloat(userWebsetFontDefaultSize)
  const sizeScale = userWebsetFontDefaultSize / DEFAULT_FONT_SIZE

  function setRemUnit() {
    let width = docEl.clientWidth
    /* if (width > 750) {
      width = 750
    } */
    
    const rem = (width * 100) / 1080 / sizeScale
    docEl.style.fontSize = rem + 'px'
  }
  var resizeEvt = 'orientationchange' in window ? 'orientationchange' : 'resize'
  window.addEventListener(resizeEvt, setRemUnit, false);
      document.addEventListener('DOMContentLoaded', setRemUnit, false);
    </script>
    <style>
        html,body{
            width: 100%;
            height: auto;
            margin: 0;
            background: #f3f3f1;
            font-size: 0;
            user-select:none;
        }
        body{
            text-size-adjust: 100% !important;
            -webkit-text-size--adjust: 100% !important;
        }   
        .warp{
            width: 100%;
            background: white;
        }
        img{
            width: 100%;
        }

        /* 动画s */
        .whiteBg{
            font-size: 0px;
            position: relative;
        }
        .textAb{
            position: absolute;
            top: 0;
            left: 0;
            text-align: center;
            width: 100%;
            color: #2db97a;
            line-height: 1;
            font-weight: bold;
        }
        .gif{
            font-size: 1.2rem;
        }
        .day{
            font-size: 0.38rem;
            font-weight: 500;
            margin-top: 0.25rem;
        }
        .day > svg{
            vertical-align: bottom;
        }
        .textLR{
            padding: 0 3px;
        }
        /* 动画end */

        /* 时间s */
        .timeWarp{
            position: relative;
            font-size: 0;
        }
        .time{
            font-family: arial,sans-serif;
            position: absolute;
            top: 0;
            right: 0;
            text-align: right;
            font-size: .42rem;
            font-weight: 400;
            padding-right: 1.5rem;
            box-sizing: border-box;
            color: #6c6c6c;
        }
        /* 时间end */

        /* 删除 */
        .warp{
            z-index: 2;
            position: relative;
        }
        .del{
            position: relative;
            top: -400px;
            z-index: 1;
            object-fit: cover;
            contain: block-size;
            vertical-align: baseline;

        }
    </style>
